// In VerticalMenu.js
import React from 'react';
import { Link } from 'react-router-dom';
import classes from './VerticalMenu.module.css'; // Use the module.css extension

function VerticalMenu({ patientName, clientCode }) {
    return (
        <div>
            <div className={classes.vmHeaderContent}>
                <Link to={'/'} ><div className={classes.vmLogo}><img src={logo} alt="Logo" /></div></Link>
                <div className={classes.vmPatientInfo}>
                    <div className={classes.vmPatientName}>{patientName}</div>
                    <div className={classes.vmClientCode}>Client Code: {clientCode}</div>
                </div>
            </div>

            <div className={classes.vmVerticalMenu}>
                <div className={classes.vmSideMenu}>
                    <nav>
                        <ul>
                            <li><Link to={'/results'}>Rezultate</Link></li>
                            <li><Link to={'/appointments'}>Consultatii</Link></li>
                            <li><Link to={'/active-appointments'}>Programari active</Link></li>
                            <li><Link to={'/make-appointment'}>Fa o programare</Link></li>
                        </ul>
                    </nav>
                </div>
            </div>
        </div>
    );
}

export default VerticalMenu;
